The face of a baby with a small tuft of hair on top of its head. Some platforms show the baby sucking on a pacifier, and some platforms show a single tooth in the baby&rsquo;s open mouth. Android previously displayed this emoji as a swaddled baby.

On Snapchat, the baby emoji signifies a new friend on the service. This emoji can also be used in the context of the meme &ldquo;I&rsquo;m baby.&rdquo;

See also üëº Baby Angel.

The hairy shell of a tropical coconut, cracked in half to show its milky-white meat. 

Google previously displayed a whole coconut alongside a half-shell.

During the summer of 2024 this emoji became associated with then-Vice President of the Untied States Kamala Harris, referencing a viral clip of a speech made in May 2023 where she stated: "You think you just fell out of a coconut tree? You exist in the context of all in which you live and what came before you.&rdquo;

A white piece of paper with text written on it by a yellow pencil, positioned over the sheet, tip down, at a 45&deg; angle. Commonly used for content concerning various types of documents and writing, including signing (in sports).

WhatsApp and Facebook&rsquo;s designs depict an old-fashioned office memorandum on pink paper. Apple&rsquo;s suggests an informal note with the easter egg of handwritten text from its 1997&ndash;2002 Crazy Ones/Think Different ad campaign: Here&rsquo;s to the crazy ones. The misfits. The rebels. The troublemakers. The round pegs in the square holes&hellip;

Not to be confused with üìÑ Page Facing Up or other emojis featuring sheets of paper.

A small pouch with a clasp, generally used to hold coins. Sometimes called a &ldquo;coin purse.&rdquo;

Color varies by platform, though most platforms have a pink, blue, or turquoise bag with a silver or gold (gray or yellow) clasp.

Not to be confused with üëù Clutch Bag, which can look like a coin person on some platforms, due to lack of relative scale in emoji designs.

A red envelope, as gifted with money on Chinese New Year or on other joyous occasions, such as weddings, in Chinese and some other Asian cultures around the world.

Depicted as a red, vertical envelope with a gold design, typically featuring the Chinese character Á¶è (f&uacute;, &ldquo;good fortune, luck, happiness"). Google&rsquo;s design previously featured the character upside down, indicating &ldquo;good luck arrives.&rdquo;

Often used to celebrate and wish good fortune on Chinese New Year (Lunar New Year, Spring Festival). Also used to represent gifts, celebration, Chinese culture, and the color red more generally.

An ancient scroll, unrolled to reveal text on papyrus or parchment paper. May be used to represent the study of history or official documents, such as a diploma.

Many platforms indicate text with dark lines. WhatsApp&rsquo;s design includes wooden rollers. Apple&rsquo;s design features an easter egg, script of text from its 1997&ndash;2002 Crazy Ones/Think Different ad campaign:

&hellip;rebels. The troublemakers. The round pegs in the square holes. The ones who see things differently. They're not fond of rules. And they have no respect for the status quo. You can quote them, disagree with them, glorify or vilify them. About the only thing you can't do is ignore&hellip;

A person shrugging their shoulders to indicate a lack of knowledge about a particular topic, or a lack of care about the result of a situation. &macr;\_(„ÉÑ)_/&macr;

Displays as raised shoulders, sometimes in conjunction with raised arms and flat hands. The shrug gesture in text (emoticon / kaomoji) form is known as a shruggie and typed as: &macr;\_(„ÉÑ)_/&macr;

The Unicode character Shrug ("Person Shrugging") does not specify a gender, though it was previously shown as a woman on most platforms. See also Woman Shrugging or Man Shrugging.
